package com.apms.cache.vo;

import java.io.Serializable;

public class OrganizationVo implements Serializable {

	private static final long serialVersionUID = -2914958348660621318L;

	private String id;
	
	private String name;
	
	private String code;
	
	private String orgLevel; //航空公司
	
	private String ismaintenance ;//是否航线保障部门
	
	private String baseOrgId; //所属的维修基础
	
	private String airportId;//所属机场
	
	private String airportCode3;//机场三字码
	
	private String airlineId;//所属航空公司
	
	private String airlineIataCode;//所属航空公司三字码

	public String getId() {
		return id;
	}

	public void setId(String id) {
		this.id = id;
	}

	public String getName() {
		return name;
	}

	public void setName(String name) {
		this.name = name;
	}

	public String getCode() {
		return code;
	}

	public void setCode(String code) {
		this.code = code;
	}

	public String getOrgLevel() {
		return orgLevel;
	}

	public void setOrgLevel(String orgLevel) {
		this.orgLevel = orgLevel;
	}

	public String getIsmaintenance() {
		return ismaintenance;
	}

	public void setIsmaintenance(String ismaintenance) {
		this.ismaintenance = ismaintenance;
	}

	public String getBaseOrgId() {
		return baseOrgId;
	}

	public void setBaseOrgId(String baseOrgId) {
		this.baseOrgId = baseOrgId;
	}

	public String getAirportId() {
		return airportId;
	}

	public void setAirportId(String airportId) {
		this.airportId = airportId;
	}

	public String getAirportCode3() {
		return airportCode3;
	}

	public void setAirportCode3(String airportCode3) {
		this.airportCode3 = airportCode3;
	}

	public String getAirlineId() {
		return airlineId;
	}

	public void setAirlineId(String airlineId) {
		this.airlineId = airlineId;
	}

	public String getAirlineIataCode() {
		return airlineIataCode;
	}

	public void setAirlineIataCode(String airlineIataCode) {
		this.airlineIataCode = airlineIataCode;
	}
	
	
	
	
}
